// src/App.js
import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import ViewUser from "./projectmongo/ViewUser";
import AddUser from "./projectmongo/AddUser";

const App4 = () => {
  return (
    <BrowserRouter>
    
      <Routes>
        <Route path="/" element={<AddUser />} />
        <Route path="/view-user" element={<ViewUser />} />
      </Routes>
    </BrowserRouter>
  );
};

export default App4;
